import React from 'react'
import Sidenav,{Toggle,NavItem,NavIcon,NaText,} from "@trendmicro/react-sidenav"
import "@trendmicro/react-sidenav/dist/react-sidenav.css"
import Home from './Home';
function MySidenav() {
  return (
    <Sidenav
    onSelect={selected=>{
        console.log(selected)
    }}>
        <Sidenav.Toggle/>
        <Sidenav.Nav defaultSelected="home">
            <NavItem>
                <NavIcon><i className='faa' style={{fontSize:1.5}}></i></NavIcon>
                    <NavText>Home</NavText>
                
            </NavItem>
        </Sidenav.Nav>
    </Sidenav>
  )
}

export default MySidenav
